import "./ListProdukt.css";
import Iphone from "../../resources/nature.jpg";

function ListProdukt() {
    return(
        <div className="product__frame border rounded border-primary">
            <div className="product__content">
                <div className="content__img">
                    <img className="img" src={Iphone}></img>
                </div>
                <div className="content__title">
                    <p>Yamaha Dt 2012</p>
                </div>
                <div>
                    
                </div>
            </div>
        </div>
    )
}

export default ListProdukt;
